import home from './Pages/Home'
import './App.css';
import React from 'react';
import { Route, Router, Routes } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path='./Pages/Home' element={<home/>}/>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
